import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsx mdx */
import Post from "@/components/Post"

import { waynedahlberg } from "@/authors";
import image1 from "./IMG_696626613127380-edit.jpg";
export { getStaticProps } from "@/getStaticProps";
export const meta = {
  title: `Mid-year R2D2 update`,
  description: `It's been a while`,
  date: "2019-06-06T14:24:00.000Z",
  authors: [waynedahlberg],
  discussion: "https://github.com/tailwindlabs/tailwindcss/discussions/2511"
};
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  meta
};
const MDXLayout = (props) => <Post meta={meta} {...props} />
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">




    <p>{`2020 has been a year, and we're barely in June. I'm really looking forward to WWDC on the 22nd. I've spent a lot of quarantine time studying SwiftUI and Combine, and creating an every growing list of iOS app and game ideas.`}</p>
    <img src={image1} alt="r2d2 update" />
    <p>{`Progress on the droid as slowed to a trickle, but certain events have provided more time on that. I've sold my previous chain drive motors and opted for a brushless hub electric motor setup. After purchasing a couple e-bikes for the family, I am really impressed with the silence and torque curve of these motors. The motor controllers are outrageously expensive, but provide precise signal mixing and the ability to move the droid at a near dead slow creep. This is really important to me because it will be around children frequently and I want it as safe as possible (it's coming in at a whopping 120lb of aluminum already).`}</p>
    <p>{`I'm finishing a small iOS app currently. Once that is submitted to Testflight with a few folks, I'll get some feedback and then push to the App Store. The next project in the queue is a simple grid-like puzzle game with a very fun theme. Can't wait.`}</p>

    </MDXLayout>;
}

